import React from "react";
import { Form } from "./form";
import styled, { css } from 'styled-components';
import {Title} from './title';

const Container = styled.div`
    font-family: Calibri, Candara, Segoe, "Segoe UI", Optima, Arial, sans-serif;
    @media only all and (max-width: 1440px) {
        max-width: 100%!important;
        flex: 0 0 100%!important;
    }
    & iframe{
        margin-bottom: 40px;
    }
`;
const TitleGuarda = styled.div`
    font-weight: bold;
    font-size: 34px;
    line-height: 41px;
    text-transform: uppercase;
    color: #FFFFFF;
    margin-top: 40px;
    margin-bottom: 24px;
`;
const AddressContainer = styled.div`
    margin-top: 40px;
    margin-bottom: 60px;

`;
const Address = styled.div`

`;
const AddressBlock = styled.div`
    font-weight: normal;
    font-size: 18px;
    margin-left: 15px;
    margin-top: 30px;
    ${props => props.none && css`
        margin-top: 0px;
    `}
    ${props => props.none2 && css`
        margin-top: 17px;
    `}
    ${props => props.two && css`
        margin-top: 65px;
    `}
`;
const SmallIcon = styled.img`
    width: 30px;
    height: 30px;
    margin-top: 60px;
    margin-left: 20px;
    margin-right: 20px;
    ${props => props.none && css`
    margin-top: 15px;
    `}

`;
const Line = styled.div`
    width: 2px;
    height: 245px;
    background: #828282;
`;
const TitileContact = styled.div`
    font-weight: bold;
    font-size: 20px;
`;
const TextContact= styled.div`
    font-weight: normal;
    font-size: 18px;
    margin-top: -7px;

`;
function Contatti() {
    return(
        <>
        <Title/>
        <Container className="col-sm-8 mx-auto row">
            <TitleGuarda className="mx-auto text-center col-sm-12">CONTATTI</TitleGuarda>
            <AddressContainer className="row col-sm-12">
                <Address className="col-sm-3 mx-auto row">
                    <div className="col-sm-3 p-0">
                        <SmallIcon src="images/location.svg" none></SmallIcon>
                        <SmallIcon src="images/location.svg"></SmallIcon>
                        <SmallIcon src="images/location.svg"></SmallIcon>
                    </div>
                    <Line></Line>
                    <div className="col-sm">
                        <AddressBlock none>
                            <TitileContact>TRENTO</TitileContact>
                            <TextContact>Via Praga N. 5</TextContact>
                        </AddressBlock>
                        <AddressBlock>
                            <TitileContact>SEREGNO</TitileContact>
                            <TextContact>Via Montorfano N.70/76</TextContact>
                        </AddressBlock>
                        <AddressBlock>
                            <TitileContact>OLBIA</TitileContact>
                            <TextContact>Via Liguria N.1</TextContact>
                        </AddressBlock>
                    </div>
                </Address>
                <Address className="col-sm-3 mx-auto row">
                    <div className="col-sm-3 p-0">
                        <SmallIcon src="images/whatsapp.svg" none></SmallIcon>
                        <SmallIcon src="images/facebook.svg"></SmallIcon>
                        <SmallIcon src="images/youtube.svg"></SmallIcon>
                    </div>
                    <Line></Line>
                    <div className="col-sm">
                        <AddressBlock none2>+39 393 989 3909</AddressBlock>
                        <AddressBlock two>@nickname</AddressBlock>
                        <AddressBlock two>@nickname</AddressBlock>
                    </div>
                </Address>
                <Address className="col-sm-3 mx-auto row">
                    <div className="col-sm-3 p-0">
                        <SmallIcon src="images/mail.png" none></SmallIcon>
                    </div>
                    <Line></Line>
                    <div className="col-sm p-0">
                        <AddressBlock none2>fabrizio@tanteauto.it</AddressBlock>
                    </div>
                </Address>
            </AddressContainer>
            <iframe className="mx-auto" width="980" height="430" src="https://maps.google.com/maps?width=980&amp;height=430&amp;hl=en&amp;q=TRENTO%20Via%20Praga%20N.%205+(%D0%9D%D0%B0%D0%B7%D0%B2%D0%B0%D0%BD%D0%B8%D0%B5)&amp;ie=UTF8&amp;t=&amp;z=13&amp;iwloc=B&amp;output=embed" frameborder="0" scrolling="no" marginheight="0" marginwidth="0"></iframe>     
        </Container>
        <div className="row d-flex justify-content-center">
            <Form/>
        </div>
        </>
    );
}
export {Contatti};
